import React from "react";
import { usenavigate } from "react-router-dom";

const Thailand = () => {
  let navigate = useNavigate();
  return (
    <div>
      <h1> about TH information </h1>
      <button
        onClick={() => {
          navigate("/pages-main");
        }}
      ></button>
    </div>
  );
};

export default Thailand;
